=head1 DESCRIPTION

Includes the error code and error message for events that could not be
ingested by CloudTrail.

=head1 ATTRIBUTES


=head2 B<REQUIRED> ErrorCode => Str

The error code for events that could not be ingested by CloudTrail.
Possible error codes include: C<FieldTooLong>, C<FieldNotFound>,
C<InvalidChecksum>, C<InvalidData>, C<InvalidRecipient>,
C<InvalidEventSource>, C<AccountNotSubscribed>, C<Throttling>, and
C<InternalFailure>.


=head2 B<REQUIRED> ErrorMessage => Str

The message that describes the error for events that could not be
ingested by CloudTrail.


=head2 B<REQUIRED> Id => Str

The original event ID from the source event that could not be ingested
by CloudTrail.



